import React, { useEffect, useState } from "react";

import MainCSS from './styles/Main.module.css'
import AppCSS from './styles/App.module.css'

import GridCard from './Card/GridCard';
import Form from "./Form/Form";

export default function Main() {
    let [statePage, setStatePage] = useState(<GridCard />)

    useEffect(() => {
        fetch('/create').then((res) => {
            return res.json()
        }).then(res => {
            return setStatePage(res)
        })
        fetch('/home').then((res) => {
            return res.json()
        }).then(res => {
            return setStatePage(res)
        })
    }, [])


    return (<>
        <main>
            <div className={MainCSS.wrapper}>
                {statePage}
            </div>
        </main>
    </>)
}
